import React from "react";
import { useHistory } from "react-router-dom";

const Error = () => {
  const history = useHistory();
  return (
    <>
      <h1>404 Page</h1>
      <button
        onClick={() => {
          {
            history.push("/");
          }
        }}
      >
        Go Back
      </button>
    </>
  );
};

export default Error;
